function parseScript(r){for(var i=new Array;r.indexOf("<script")>-1||r.indexOf("</script")>-1;){var n=r.indexOf("<script"),t=r.indexOf(">",n),s=r.indexOf("</script",n),c=r.indexOf(">",s);i.push(r.substring(t+1,s)),r=r.substring(0,n)+r.substring(c+1)}for(var e=0;e<i.length;e++)try{Function('"use strict";'+i[e])()}catch(r){}}